import React from 'react';
import { Navbar, Nav, Container, NavItem, Tabs, Tab } from 'react-bootstrap';
import {Link} from "react-router-dom";
import AddProduct from './AddProduct';
import AddUser from './AddUser';
import ChangeProduct from './ChangeProduct';
import ChangeUser from './ChangeUser';
import RemoveProduct from './RemoveProduct';
import RemoveUser from './RemoveUser';
import { useLocation } from 'react-router-dom';

export default function AdminUi(props) {

    const location = useLocation();
    const params = new URLSearchParams(location.hash);

    console.log(JSON.stringify([...params.entries()]));
    console.log(params.values());

    console.log(params.has("#link"))

    return(
        <div className="main">
        <Navbar bg="light" expand="lg">
        <Container>
            <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="me-auto" type="tabs">
                    <Nav.Link href="#addUser">add User</Nav.Link>
                    <Nav.Link href="#removeUser">remove User</Nav.Link>
                    <Nav.Link href="#changeUser">change User</Nav.Link>
                    <Nav.Link href="#addProduct">add Product</Nav.Link>
                    <Nav.Link href="#removeProduct">remove Product</Nav.Link>
                    <Nav.Link href="#changeProduct">change Product</Nav.Link>
                
                </Nav>
            </Navbar.Collapse>
        </Container>
        </Navbar>
        {params.has("#addUser") && <AddUser />}
        {params.has("#removeUser") && <RemoveUser />}
        {params.has("#changeUser") && <ChangeUser />}
        {params.has("#addProduct") && <AddProduct />}
        {params.has("#removeProduct") && <RemoveProduct />}
        {params.has("#changeProduct") && <ChangeProduct />}

        <Tabs  defaultActiveKey="home" id="noanim-tab-example" className="mb-3">
            <Tab eventKey="addUser" title="Add User">
                <AddUser />
            </Tab>
            <Tab eventKey="removeUser" title="Remove User">
                <RemoveUser />
            </Tab>
            <Tab eventKey="changeUser" title="Change User">
                <ChangeUser />
            </Tab>

            <Tab eventKey="addPrdouct" title="Add Product">
                <AddProduct />
            </Tab>
            <Tab eventKey="removeProduct" title="Remove Product">
                <RemoveProduct />
            </Tab>
            <Tab eventKey="changeProduct" title="Change Product">
                <ChangeProduct />
            </Tab>
        </Tabs>
            <Link to="/">{"back"}</Link><br />
            
            
        </div>
        
    );
}
